script: |
  super -f text -I q1688.spq | sort > q1688.out

inputs:
  - name: q1688.spq
    data: |
      SELECT DISTINCT 78 * + ( 5 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + 18 + + 38 + - col2 * col1 / col1 ) NOT BETWEEN + col2 AND + col1 + + 29;
  - name: tab1

outputs:
  - name: q1688.out
    data: |
      390
